/* eslint-disable */
import React from 'react';
import { TreeNode } from 'react-organizational-chart';
import { Card } from '@material-ui/core';


// material-ui
import { Avatar, Button, CardActions, CardContent, Divider, Grid, Typography } from '@material-ui/core';

// project imports
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

// assets
import Avatar1 from 'assets/images/users/avatar-1.png';
import Avatar2 from 'assets/images/users/avatar-2.png';
import Avatar3 from 'assets/images/users/avatar-3.png';
import Avatar4 from 'assets/images/users/avatar-4.png';

import TeamMembers from './TeamMembers';


function Child({children, users}) {
    function renderChild(child) {
        if (child.children.length > 0) {
            return (<Child children={child.children} users={users}/>);
        }
    }
    return (
        <>
            {children.map((child)=>{
                let passUsers = [];
                users.forEach((user) => {
                    if (user.section_id === child.value.section_id) {
                        passUsers.push(user);
                    }
                })
                return (
                    <>
                        <TreeNode label={<TeamMembers title={child.value.name} userData={passUsers}/>}>
                            {renderChild(child)}
                        </TreeNode>
                    </>
                )
            })}
        </>
    );
}

export default Child;
